  `aid` int(11) NOT NULL AUTO_INCREMENT,
  `FirstName` varchar(45) DEFAULT NULL,
  `LastName` varchar(45) DEFAULT NULL,
  `MsgRole` varchar(80) DEFAULT 'admin',
  `MsgAdminNum` char(15) DEFAULT NULL,
